const App = () => {
  return (
    <>
      <h1 className="heading_style"> List of top 5 Netflix Series in 2020 </h1>

      {Sdata.map((netdata) => {
        return (
          <Card
            key={netdata}
            imgscr={netdata.imgsrc}
            sname={netdata.sname}
            title={netdata.title}
            links={netdata.links}
          />
        );
      })}
    </>
  );
};

export default App;
